import React from "react";

function dashboard() {
  return (
    <React.Fragment>
    <div className="nav bg-dark">
        <a className="mx-1">Home</a>
        <a className="mx-1">Explore</a>
        <a className="mx-1">My Basket</a>
        <a className="mx-1">Profile</a>
    </div>

    </React.Fragment>
  )
}

export default dashboard
